import React from 'react'
import Grid from "./Grid"
import logo from "../assets/images/Logo-2.png"
import { Link } from "react-router-dom"
const footerAboutLinks = [
    {
        display: 'Gioi thieu',
        path: '/about'
    },
    {
        display: 'Lien he',
        path: '/about'
    },
    {
        display: 'Tuyen dung',
        path: '/about'
    },
    {
        display: 'Tin tuc',
        path: '/about'
    },
    {
        display: 'He thong cua hang',
        path: '/about'
    }

]
const footerCustomerLink = [
    {
        display: 'Chinh sach doi tra',
        path: '/about'
    },
    {
        display: 'Chinh sach bao hanh',
        path: '/about'
    },
    {
        display: 'Chinh sach hoan tien',
        path: '/about'

    },
]
const Footer = () => {
    return (
        <footer classsName="footer">
            <div className="container">
                <Grid
                    col={4}
                    mdCol={2}
                    smCol={1}
                    gap={10}
                >
                    <div>
                        <div className="footer__title">
                            Tong dai ho tro
                        </div>
                        <div className="footer__content">
                            <p>
                                Lien he dat hang <strong>0123555451</strong>
                            </p>
                            <p>
                                That mac dat hang <strong>0123555451</strong>
                            </p>
                            <p>
                                Gop y, khieu nai <strong>0123555451</strong>
                            </p>
                        </div>
                    </div>

                    <div>
                        <div className="footer__title">
                            Ve Goong
                        </div>
                        <div className="footer__content">
                            {
                                footerAboutLinks.map((item, index) => (
                                    <p key={index}>
                                        <Link to={item.path}>
                                            {item.display}
                                        </Link>
                                    </p>
                                ))
                            }

                        </div>
                    </div>
                </Grid>
            </div>
        </footer>
    )
}

export default Footer
